import React from 'react';
import logo from './logos/MyMixer.png';
import MixerLogo from './MixerLogo/MixerLogo'

const NavBar= () =>{
  return (
    <nav class="nav-light bg-light">
      <MixerLogo />
   <div >
    <ul class="justify-content-right">
        <li class="nav-item">
          <a class="nav-link" href="essentials">Essentials</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="faq">FAQ</a>
        </li>
    </ul>
    </div>

    </nav>
  )
};
export default NavBar;
